complete_model_interaction.output:
Step 1: The key psychological mechanism in this task is fairness evaluation. In responder decisions, participants compare the monetary share offered (split_self) to the share they “deserve” based on their relative contribution (as given by token_self versus the total tokens, token_self + token_opp). This fair share is computed by multiplying their token fraction by the total combined earning. A decision to accept or reject a given proposal is then assumed to be driven by this fairness difference. A proposal that meets or exceeds the fair share produces a more positive utility and increases the probability of acceptance, while one that offers less yields a negative utility and a lower probability of acceptance.

Step 2: The model assumes that the utility U of accepting a proposal is given by a linear integration of a baseline bias parameter, alpha, and an adjustment proportional to the fairness difference. The fairness difference is computed as the difference between the offered monetary share (split_self) and the expected fair share (fair_share), where fair_share = (token_self / (token_self + token_opp)) × combined_earning.

Step 3: The mathematical form captures these interactions as follows:
  U = alpha + beta × [split_self − (token_self/(token_self + token_opp)) × combined_earning]
This utility is then converted into a probability through the logistic (sigmoid) function:
  P(accept = 1) = 1 / (1 + exp(−U))

Step 4: The parameters to calibrate are:
  • alpha: a bias parameter – capturing an overall tendency to accept or reject proposals independent of fairness. 
  • beta: a fairness sensitivity parameter – scaling the impact of the deviation between the offered and the fair share.
Generous finite bounds are provided for both parameters to help with parameter recovery.

Step 5: The model variables map as follows:
  • Data variables token_self, token_opp, combined_earning, and split_self are observed in each trial.
  • These are combined into the computed fair_share and fairness difference.
  • The computed utility U then informs the likelihood of the observed binary outcome, accept.

Below is the formal specification.

<MODEL>
P(accept=1) = 1/(1+exp(-(alpha + beta*(split_self - ((token_self/(token_self+token_opp))*combined_earning)))))
</MODEL>

